import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  const role = localStorage.getItem('role');

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-6">Dashboard</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <Link to="/products" className="p-4 bg-gray-200 rounded shadow">Manage Products</Link>
        {role === 'admin' && (
          <>
            <Link to="/categories" className="p-4 bg-gray-200 rounded shadow">Manage Categories</Link>
            <Link to="/users" className="p-4 bg-gray-200 rounded shadow">Manage Users</Link>
          </>
        )}
        <Link to="/stock" className="p-4 bg-gray-200 rounded shadow">Stock Entries</Link>
      </div>
    </div>
  );
};

export default Dashboard;
